import React from 'react'

const AdminLogin = () => {
    
  return (
    <>
    <form action="">
        <input type="text" placeholder='Enter Mail-Id' />
        <input type="text" placeholder='Enter Password' />
        <button>Admin Logiin</button>
    </form>
    </>
  )
}

export default AdminLogin
